// src/UserCard.js
import React from 'react';

function UserCard({ name, age, address }) {
  return (
    <div style={{
      border: '1px solid #ccc',
      padding: '16px',
      borderRadius: '8px',
      maxWidth: '250px',
      margin: '8px'
    }}>
      <h2>{name}</h2>
      <p>Age: {age}</p>
      <p>Address: {address}</p>
    </div>
  );
}

export default UserCard;
